import './App.css';
import {Wallet} from './Wallet';
import "./Firebase";
import { SendData } from './Firebase';
function App() {
  SendData("Atharva","pass");
  SendData("Atharva","dual");
  return (
    <div className="App">
      <div className="content">
        <div>
          <button onClick = {SendData}></button>
        </div>
        <Wallet />
      </div>
    </div>
  );
}

export default App;
